import React from 'react';
import Popup from "reactjs-popup";

const  CountDownEvent = ({title,startHourBytes,eventDuration, columID,comments,startHour,endHour})=>
{
  let leftPlace=50+columID*140; 
  return(
        <div style={{top:startHourBytes,left:leftPlace, position:"absolute", height:eventDuration,width:"140px",backgroundColor:"Yellow", border:"solid"}} >
          <div style={{float:"right",color:"red",cursor:"help", width:"auto",height:"auto"}}>x</div>
          <Popup trigger={<div style={{cursor:"help", width:"auto",height:"auto",}} > ...</div>} position="right center" >
            <div>
              <div>{startHour}-{endHour}</div>
              <div>{comments}</div>
            </div>
          </Popup>
          <div  style={{textAlign:"right"}}>{title}</div>
          </div>
  );
}
export default CountDownEvent
